import './App.css';
import {BrowserRouter as Router, Link, Route, Routes} from "react-router-dom";
import {Login} from "./Login";
import {SignUp} from "./SignUp";


function App() {
  return (
    <Router>
        <div>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/signup">Sign-Up</Link>
                    </li>
                    <li>
                        <Link to="/login">Login</Link>
                    </li>
                </ul>
            </nav>

            <Routes>
                <Route path="/login">
                    {<Login />}
                </Route>
                <Route path="/signup">
                    {<SignUp />}
                </Route>
                <Route path="/">
                    {<App />}
                </Route>
            </Routes>
        </div>
    </Router>

  );


}

export default App;
